import { AiOutlineAlignLeft } from 'react-icons/ai';
import {
	BrowserRouter as Router,
	Routes,
	Route,
	Link
  } from "react-router-dom";
  import logo from './assets/logo.JPG';
  import About from './About';
  import Home from './Home';
  import Articles from './Articles';
  import Animators from './Amimators/Animators';
  import Show from './Show';
  import MasterClasses from './MasterClasses';
  import Additional from './Additional';
  import Portfolio from './Portfolio';
  import Sweets from './Sweets';
  import Footer from './Footer';
  import Decorations from './Decorations';

function FilterAnimators({ageCategory,sexCategory,allCategory}) {


    return (

<div className="container-big">
		<div className="btn btn--white btn--icon filter-mob-btn">
			<AiOutlineAlignLeft></AiOutlineAlignLeft>Фильтры
		</div>


		<div className="filter text" >

<div className='filter-group'>
	<div className="filter-group__title menu-14">&nbsp;</div>
	<div className="filter-group__list">
		<button onClick={() => allCategory()} className='filter-group__list__item'>
			<span><mark>Все вместе</mark></span>
		</button>
	</div>
</div>

<div className="filter-group">
	<div className="filter-group__title menu-14">Для кого</div>
	<div className="filter-group__list">
                <button onClick={() => sexCategory("all")} className='filter-group__list__item'>
				<span><mark>Универсальные</mark></span>
                </button>

								<button onClick={() => sexCategory("boys")} className="filter-group__list__item ">
				<span><mark>Мальчик</mark></span>
                </button>
								<button onClick={() => sexCategory("girls")} className="filter-group__list__item ">
				<span><mark>Девочка</mark></span>
                </button>
			</div>
</div>

<div className="filter-group">
	<div className="filter-group__title menu-14">Возраст ребенка</div>
	<div className="filter-group__list">
								<button onClick={() => ageCategory("3-4 года")} className="filter-group__list__item">
				<span><mark>3-4 года</mark></span>
                                </button>
								<button onClick={() => ageCategory("5-6 лет")} className="filter-group__list__item ">
				<span><mark>5-6 лет</mark></span>
                </button>
								<button onClick={() => ageCategory("7-8 лет")} className="filter-group__list__item ">
				<span><mark>7-8 лет</mark></span>
                </button>
								<button onClick={() => ageCategory("9-10 лет")} className="filter-group__list__item ">
				<span><mark>9-10 лет</mark></span>
                </button>
			</div>
</div>		
</div>
	</div>
    )
}

export default FilterAnimators;
